import React, { Component } from "react";
import "../App.css";
import Card from "../Components/Card.js";
import BookCard from "../Components/Card.js";

class Books extends Component {
  render() {
    return (
      <div className="container-fluid" id="container-scroll">
          <div className="col-lg-12">
            <Card title="Books" style={{height: "50rem"}}
              body =
                <div className="card-deck">
                  <BookCard title="Intro to Operating Systems" message="322" height = "15rem"/>
                  <BookCard title="Data Mining" message="494"/>
                  <BookCard title="Gateway to Mathematics" message="262"/>
                </div>
            />
          </div>
      </div>
    );
  }
}

export default Books;
